import React, { Component } from 'react'

class NavButton extends Component {
    render() {

        const style = {
            textAlign: 'center',
            margin: 'auto'
        }

        return (
            <div>
                <a style={style} onClick={() => this.props.handlePageChange(this.props.name)}>{this.props.name}</a>
            </div>
        )
    }

}

export default NavButton;
